var url = new Array([]);
const api = "AIzaSyB5_Kc5h-Z72FAt4LWm7veU-UWoS8LfUPc";
fetch("https://youtube.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&key=AIzaSyB5_Kc5h-Z72FAt4LWm7veU-UWoS8LfUPc&maxResults=9", {
    headers: {
        Authorization : api,
        Accept: "application/json"
    }
}).then((response)=>{
    return response.json()
}).then((val)=>{
    for (let index = 0; index < 9; index++) {
        if (val.items[index].snippet.thumbnails.maxres === undefined) {
            url.push("url('" + val.items[index].snippet.thumbnails.standard.url + "')");
        }

        else
        {
            url.push("url('" + val.items[index].snippet.thumbnails.maxres.url + "')");
        }

        var date = new Date(val.items[index].snippet.publishedAt);
        var date_now = new Date();

        document.querySelectorAll(".main_desc")[index].innerHTML = val.items[index].snippet.title;
        document.querySelectorAll(".chnl_name")[index].innerHTML = val.items[index].snippet.channelTitle;
        document.querySelectorAll(".thumbnail")[index].style.backgroundImage = url[index+1];
        if (Math.floor((date_now - date)/(3600*24*1000)) < 2) {
          date = "1 day ago";
        }

        else if (Math.floor((date_now - date)/(3600*24*1000)) < 60) {
          date = Math.floor((date_now - date)/(3600*24*1000)) + " days ago";
        }

        else if (Math.floor((date_now - date)/(3600*24*1000)) > 60) {
          date = Math.floor(date_now - date % 3600 / 60000) + " months ago";
        }

        else
        {
          date = Math.floor((date_now - date)/(3600*24*1000*365)) + " years ago";
        }

        document.querySelectorAll(".vid_date")[index].innerHTML = date;

    }
});

function Vids() {
  return (
    <>
      <div className="vids">
        <div className="thumbnail">
        </div>
        <div className="chnl_text">
          <div className="chnl_pic">
          </div>
          <div className="vid_desc">
            <div className="main_desc"></div>
            <div className="chnl_name"></div>
            <div className="vid_stats">
              <div className="vid_views">300k views</div>
              <div className="partition">
                <div className="partition_inside"></div>
              </div>
              <div className="vid_date"></div>
            </div>
          </div>
        </div>
      </div>
    </>
  )
}

const arr = [1, 2, 3 ,4, 5, 6, 7, 8, 9];

const Home = () => {

  return(
      <>
      <div className="scroll_top">
        <div className="all bar_ele">
          All
        </div>
        <div className="gaming bar_ele">
          Gaming
        </div>
        <div className="music bar_ele">
          Music
        </div>
        <div className="sports bar_ele">
          Sports
        </div>
        <div className="live bar_ele">
          Live
        </div>
        <div className="mixes bar_ele">
          Mixes
        </div>
        <div className="computer bar_ele">
          Computer Programming
        </div>
        <div className="All bar_ele">
          All
        </div>
        <div className="All bar_ele">
          All
        </div>
        <div className="All bar_ele">
          All
        </div>
        <div className="All bar_ele">
          All
        </div>
        <div className="All bar_ele">
          All
        </div>
      </div>

      <div className="vid_holder">

        {arr.map(() => <Vids />)}
        
      </div>
      </>
    )

  };
  
  export default Home;
